import React from "react";
import "./Article.css"

export const Article = ({item}) => {
  return (
    <div className="main">
      <div class="jumbotron">
        <h5 >{item.title}</h5>


        <p class="lead">
          <a href={item.url} >
            Learn more
          </a>
        </p>
      </div>
    </div>
  );
};
